import React, { useState } from "react";
import { Link } from "react-router-dom";

// CSS
import './busca.css'

const Busca = () => {
    const [busca, setBusca] = useState('');

    return (
        <div className="Inicial">
            <h1 className="opening">
            Encontre oportunidades próximas de você e cresça a  sua rede de atuação!
            </h1>
            <fieldset>
            <form className="pesquisaHome" >
                <input className="form-home" id="buscaIput" placeholder="procure por negócios em nossa rede" type="text" value={busca} onChange={(e)=>setBusca(e.target.value)} />
                    <button className="home-send" id="buscaEmpresas"></button>
                    <p>{busca}</p>
            </form>
            </fieldset>
            <div className="advanced">
                <Link to='/todos'> LISTA DE TODOS OS NEGÓCIOS
                </Link>
            </div>
        </div>
        )
    }
export default Busca;
